import DivHomeStyled from "../../Styles/DivHome";
import Button from "../Button";
import bin from "../../Assets/bin.svg";
import axios from "axios";
import { useEffect } from "react";

const MainHome = ({ setModal, techArray, setTechArray }) => {
  console.log(techArray);
  const handleDeleteClick = (obj) => {
    console.log(obj);
    axios
      .post(`https://kenziehub.herokuapp.com/users/tech/:${obj}.id`)
      .then((res) => console.Console.log(res))
      .catch((err) => console.log(err));
  };
  return (
    <DivHomeStyled>
      <div className="headerTech">
        <p className="tech">Tenologias</p>
        <Button className="addButton" onClick={() => setModal(true)}>
          +
        </Button>
      </div>
      <div className="containerList">
        {techArray.map((obj) => {
          return (
            <div className="post">
              <p className="techName">{obj.title}</p>
              <div className="containerButton">
                <div className="level">{obj.status}</div>
                <Button
                  id={obj.id}
                  className="deletePost"
                  onClick={() => handleDeleteClick(obj)}
                >
                  <img src={bin} alt="bin" />
                </Button>
              </div>
            </div>
          );
        })}
      </div>
    </DivHomeStyled>
  );
};
export default MainHome;
